.sapWCTableRow {
  display: grid;
  align-items: center;
  background-color: #fff;
  box-sizing: border-box;
}
.sapWCTableRow:focus {
  outline: 1px solid #000;
  outline-offset: -3px;
  outline-style: dotted;
}
.sapWCTablePopinRow {
  padding: 0.25rem 1rem;
  grid-column-start: 1;
  display: flex;
  flex-direction: column;
  align-items: flex-start;
}
.sapWCTablePopinTitle {
  color: #32363a;
}
.sapMWCTableRowCellContainer {
  height: 100%;
}
.sapWCTableRowWithBorder {
  border-bottom: 1px solid #ededed;
}
